                                                                        <div class=""modal-header"">
                                                                            <h4 class=""mod");
                    WriteLiteral(@"al-title"" id=""myLargeModalLabel"">Terminos y Condiciones</h4>
                                                                            <button type=""button"" class=""close"" data-dismiss=""modal"" aria-hidden=""true"">×</button>
                                                                        </div>
                                                                        <div class=""modal-body"">
                                                                            <div style=""text-align:center;"">
                                                                                <h4>TÉRMINOS Y CONDICIONES </h4>
                                                                                <h4>USO DE LA PLATAFORMA WEB Y APP PARA COBRANZA DE RECIBOS MEDIANTE TARJETAS DE CRÉDITO/DEBITO</h4>
                                                                            </div>
                                                                            <p><b>ACERCA DEL USO DE LA PLATAFORMA.</b></p>
               ");
                    WriteLiteral(@"                                                             <p style=""text-align:justify;"">1. Al hacer uso de esta plataforma, el usuario acepta y por lo tanto autoriza que la información sea guardada en nuestros servidores, información la cual será únicamente para el uso que el usuario de esta plataforma requiera de manera expresa, ya sea por medio de esta u otros canales de atención.</p>
                                                                            <p style=""text-align:justify;"">2. En caso de que el usuario desee eliminar su información deberá de comunicarlo de manera escrita y por mesa de partes de ELECTROSUR.</p>
                                                                            <p style=""text-align:justify;"">3. Para cualquier consulta adicional por favor llame nuestra Central Telefónica de FONOSUR 52-583316(Tacna), 53-584161 (Moquegua), 53-584162 (Ilo). </p>
                                                                            <p><b>ACERCA DE LOS MEDIOS DE PAGO.</b></p>
    ");
                    WriteLiteral(@"                                                                        <p style=""text-align:justify;"">4. Actualmente solo se permite el pago por medio de tarjetas de crédito y/o debito de marca VISA, MasterCard.</p>
                                                                            <p style=""text-align:justify;"">5. En caso de extornos, estos deberán ser comunicados el mismo día de efectuada la operación, dentro del horario de Atención al Cliente de ELECTROSUR. No se aceptan extornos posteriores a la fecha de pago.</p>
                                                                            <p style=""text-align:justify;"">6. En caso de requerir otros medios de pago, por favor llamar a la Central Telefónica de FONOSUR 52-583316(Tacna), 53-584161 (Moquegua), 53-584162 (Ilo).</p>
                                                                            <p style=""text-align:justify;"">7. El cliente no asumirá ningún costo de comisión del servicio por parte de ELECTROSUR.</p>
                          ");
                    WriteLiteral(@"                                                  <p style=""text-align:justify;"">8. El cliente puede presentar reclamo por el servicio de acuerdo al procedimiento de reclamos de ELECTROSUR.</p>
                                                                            <p style=""text-align:justify;"">9. El mecanismo de pago a través del uso de tarjetas de crédito/débito es facultativo a elección del cliente.</p>
                                                                            <p style=""text-align:justify;"">10. El uso, las condiciones de pago y otras condiciones aplicables a las tarjetas de crédito, son de exclusiva responsabilidad de la entidad financiera emisora de su tarjeta.</p>
                                                                            <p><b>DELIMITACION DE RESPONSABILIDADES.</b></p>
                                                                            <p style=""text-align:justify;"">11. ELECTROSUR S.A. no se hará responsable por daños y perjuicios frente a los usuarios com");
                    WriteLiteral(@"o consecuencia directa o indirecta de la interrupción, suspensión o finalización de los servicios ofrecidos a través de esta pasarela de pagos, siendo esto responsabilidad de la entidad financiera emisora de la tarjeta.</p>
                                                                            <p style=""text-align:justify;"">12. ELECTROSUR S.A., no se hará responsable por los errores que cometa el usuario en el registro de los datos solicitados para el pago de los servicios en esta plataforma virtual, asimismo, antes de proceder con el pago, el usuario tiene el deber de verificar que toda la información registrada sea la correcta.</p>

                                                                            <p><b>CONSULTAS Y/O RECLAMOS.</b></p>
                                                                            <p style=""text-align:justify;"">13. Para cualquier consulta relacionada a la operatividad o uso de esta pasarela de pagos, deberá hacerla llegar a nuestra Central Telefónica de FONOSUR 52");
                    WriteLiteral(@"-583316(Tacna), 53-584161 (Moquegua), 53-584162 (Ilo).</p>
                                                                            <p style=""text-align:justify;"">14. Los reclamos y/o quejas, relacionadas al no reconocimiento del trámite o errores en los datos consignados para el pago, deberán ser presentados por el trámite correspondiente en Mesa de Partes física o virtual de ELECTROSUR.</p>
                                                                            <p style=""text-align:justify;"">15. Los reclamos relacionados al rechazo o denegatoria de una transacción efectuada o al no reconocimiento de los pagos en línea con tarjetas de crédito/débito, deberán ser presentadas por los usuarios titulares ante las entidades financieras emisoras de estas tarjetas de crédito/débito en las oficinas de atención correspondientes. En conclusión, de encontrarse el usuario (titular de la tarjeta) ante una contingencia respecto al pago efectuado en el Aplicativo web o app móvil para pagos con tarjeta VISA de recibo");
                    WriteLiteral(@"s de energía, deberá presentar su reclamo en la empresa del sistema financiero, indicando las transacciones que no reconoce en su tarjeta, debiendo proporcionar la información que la empresa del sistema financiero le solicite y seguir el procedimiento que ésta le indique. Finalmente, y a mayor abundamiento, los titulares de la tarjeta no asumirán responsabilidad por las transacciones no autorizadas que se hayan realizado con posterioridad a la comunicación del robo o extravío. Sin embargo, las que se realicen con anterioridad a dicha comunicación, serán de responsabilidad exclusiva de los titulares o usuarios. </p>



                                                                            <p><b>GENERALES.</b></p>
                                                                            <p style=""text-align:justify;"">16. Estas condiciones pueden cambiar sin previo aviso y estarán publicadas en la página web institucional de ELECTROSUR.</p>


